import React, { useState } from 'react';
import Sre from './Sre';

const Search = () => {
    const [img, setImg] = useState("");
    
    const inEv = (event) => {
        const data = event.target.value;
    
        setImg(data);
    }
    
    return(
        <>
            <input type="text" placeholder="search" onChange={inEv} value={img}/>
            <Sre name="img"/>
        </>
    );
};

export default Search;
